import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input to be visible
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Focus and type a query that triggers autocomplete
    await page.click('#searchInput');
    await page.type('#searchInput', 'iph');

    // Wait for suggestions box to appear
    await page.waitForSelector('.search-suggestions', { timeout: 5000 });

    // Take screenshot of the autocomplete suggestions
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_autocomplete.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_autocomplete.png'));

    // Extract suggestions text
    const suggestions = await page.$$eval('.suggestion-item', els => els.map(e => e.textContent.trim()));

    // Click the first suggestion if available
    if (suggestions.length > 0) {
      await page.click('.suggestion-item');
      // Wait for search results to load (look for "Search Results" heading)
      await page.waitForSelector('h2', { timeout: 5000 });
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));
    }

    // Extract the search input value after suggestion selection
    const searchInputValue = await page.$eval('#searchInput', el => el.value);

    return {
      success: true,
      action: "Tested search autocomplete: triggered suggestions, extracted them, selected the first, and verified search results.",
      extractedData: {
        suggestions,
        searchInputValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
